import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Dietaryschedule = () => {
  const [nutritionData, setNutritionData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:3000/Nutrition');
        setNutritionData(response.data);
      } catch (error) {
        console.error('Error fetching nutrition data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="bg-white rounded shadow-md max-w-xl mx-auto p-4 mt-4 ml-4">
      <div className="text-2xl font-bold mb-4">Bodybuilder's Nutrition Facts</div>
      <table className="w-full border-collapse">
        <thead>
          <tr className="border-b border-gray-300">
            <th className="py-2 font-medium pr-4">Nutrient</th>
            <th className="py-2 pr-4">Amount</th>
            <th className="py-2">% Daily Value</th>
          </tr>
        </thead>
        <tbody>
          {nutritionData &&
            nutritionData.map((item, index) => (
              <tr key={index} className="border-b border-gray-300">
                <td className="py-2 pr-4 font-medium">{item.nutrient}</td>
                <td className="py-2 pr-4">{item.amount}</td>
                <td className="py-2">{item.dailyValue}</td>
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dietaryschedule;
